        "id": 12790535,
        "code": "ENTMQMAAS-988",
        "name": "Docs: Issue with address auto-create in broker; document workaround and examples",
        "projectKey": "ENTMQMAAS",
        "description": "*Situation:* When you create a receiver/consumer against the broker, it creates an address in the broker.  If you are wanting to be a topic consumer, you want that address to be multicast so any message that goes in to goes to all potential subscribers. \r\n\r\n*Problem:* Where we have a hierarchical topic, the address created is the topic name, `foo`. So if someone subscribes to foo/bar/*, that is created as a new address by the broker, even though its really just a subcategory of `foo`. \r\n We in EnMasse have created `foo` as a multicast, but Broker creates it as anycast.\r\n If you create lots of subscriptions to foo/bar/*, then the message only goes to one of them, not all of them. \r\n\r\n*Solution:* There is a way of telling the broker, in AMQP (Rob isnt sure about other protocols) by setting a capability in the source thats part of the subscribe exchange. The JMS client does this by default, but we dont have it explained for any other clients. \r\n \r\nHelp in the Console says to set the capability topic in the source to make that happen. Need the steps for how to do this for every language. Justin Ross is the SME for this, to provide the examples. Vanessa also indicated that she has a Python example.  \r\n\r\nPer Rob, \\\"we should document this and then see if there is a broker change that can be made for broker 7.3 / online 1.1\\\"\r\n\r\n\\\"If you create a subscription on a topic, any senders to that topic must specify the topic capability.\\\"\r\n\r\n",
