        "description": "When installing and upgrading the operator from 1.4.4 to 1.5.0 on OCP 4.4, the system is refusing to upgrade due to a change in CRD versions served.\r\n\r\n\r\n\r\nThe catalog operator provides the error in the logs\r\n\r\n\r\n{code:java}\r\n2848:2020-07-07T16:42:57.420931222Z E0707 16:42:57.420435       1 queueinformer_operator.go:290] sync {\\\"update\\\" \\\"amq-online-infra/install-v2sxw\\\"} failed: error missing existing CRD version(s) in new CRD: addressplans.admin.enmasse.io: New CRD (addressplans.admin.enmasse.io) must contain existing served versions (v1be {code}\r\n\r\n\r\n\r\n\r\nTo work around:\r\n\r\n\r\n{code:java}\r\noc delete subscription <name> -n <operator install namespace>\r\noc delete --cascade=false csv amq-online.1.4.4 -n <operator install namespace>\r\noc delete --cascade=false csv amq-online.1.5.0 -n <operator install namespace>{code}\r\nThe operator and all addresses will continue to work.\r\n\r\n\r\n\r\nAs the last step, recreate the subscription to receive updates and allow 1.5.0 installation to succeed.",
